import React from "react";
import ReactPlayer from "react-player";

const Home = () => {
    return (
        <div>
        <div className="container-fluid">
            <div className="row">
                <div className="log-image">
                <img className="logo1-image" src={process.env.PUBLIC_URL + "/Images/image.jpg"} alt="Random_Image" />
                <div className="player">
                    <ReactPlayer height="15rem" width="20rem" controls url="https://www.youtube.com/watch?v=vxBXWVsEchk&ab_channel=NetflixNetflixVerified"/>
                </div>
                </div>
            </div>
        </div>
        </div>
    )
};

export default Home;
